import axios from 'axios';

export const fetchCharacter = async () => {
  console.log('bbbbb');
  const { data } = await axios.get('https://swapi.py4e.com/api/people/1/');
  if (data) {
    console.log('aaaa', data);
    return data;
  }
};

export const getSpeciesName = async (url) => {
  const { data } = await axios.get(url);
  if (data && data.name) {
    return data;
  }
};

export const getFilmName = async (url) => {
  const { data } = await axios.get(url);
  if (data && data.episode_id) {
    return data;
  }
};
